delete from tb_localidade where ci_localidade in(
select foo2.dup from
(select ds_localidade, min(ci_localidade) as dup from tb_localidade 
where sg_estado = 'CE'
  and ds_localidade in(
select foo.ds_localidade from
(select sg_estado, ds_localidade 
from tb_localidade where sg_estado = 'CE'
group by 1,2
having count(*) > 1) as foo)
group by 1) as foo2);

